  return (
    <>
      <Nav />
      <div className = "content" style={{
        width: '100%',
        boxSizing: 'border-box',
        padding: '0 calc(1rem + 10%)',
      }}>
        <Courses />
        <Cart />
      </div>
    </>
  );
}

export default App;
